
function scan_and_output()
{
    local folder=$@
    if [ -d "$HOME/sprdspace/kitkatsprd/packages/$folder" ] ; then
        echo "Generating is $folder"
        mkdir -p $folder
        if [ -d "$folder/../res" ] ; then
           echo -e "LOCAL_PATH := \$(call my-dir)\ninclude \$(call all-makefiles-under,\$(LOCAL_PATH))" > $folder/../Android.mk
        fi
    fi
}

